import React from "react";

const HomePage = () => {
  return (
    <div className="page-content">
      <h1>Digitalflake</h1>
      <br></br>
      <h1>Welcome to Digitalflake Admin</h1>
      <button className="logout-btn">Logout</button>
    </div>
  );
};

export default HomePage;
